import React from 'react'
//import {NavLink} from "react-router-dom";



const Services = () => {
    return (
        <div className='section-services' id='services'>
           <h2>Buying and Selling</h2>

            <div>
            We understand that buying or selling a home is more than just a transaction: it’s a life-changing experience. 
            That’s why we are dedicated to providing exceptional, personalized service for all of our clients. 
            We take great pride in the relationships we build and always work relentlessly on the client’s behalf to help them achieve their real estate goals.

            </div>

Our team of experts represent the best and brightest in the industry, and we’re always striving to lead the field in research, innovation, and consumer education. Today’s buyers and sellers need a trusted resource that can guide them through the complex world of real estate. With our extensive knowledge and commitment to providing only the best and most timely information to our clients, we are your go-to source for real estate industry insight and advice.

The highest level of service, regardless of your timeframe or price point, is the cornerstone of our unprecedented success and is our continued promise to you. Our experienced team works together to ensure that YOU always receive the extraordinary service you expect and deserve.

Success, we believe, is not in the number of deals, but in the way we deal with people. We don’t measure success through achievements or awards, but through the satisfaction of our clients. Your success it truly our success.
        </div>
    )
}

export default Services
